import React from "react";
import './Button.css';
const Button = ({text, color, iconClass, onclick}) => {
	return(
		<button onClick={onclick} className="button" style={{backgroundColor: color}}>
            {text}
            <i className={iconClass}></i>
        </button>
	)
};

export default Button;
